local L_NamesByNum = {
   Id = 1,
   Camp = 2,
   Card = 3,
   Rank = 4,
   Level = 5,
}
local L_NamesByString = {
   Att = 6,
   Condition = 7,
}
local L_ColNameIndexs = {
   Id = 0,
   Camp = 1,
   Card = 2,
   Rank = 3,
   Level = 4,
   Att = 5,
   Condition = 6,
}
--local L_ColumnUseBitCount = {20,4,6,5,5,17,17,}
